import React from 'react'
import './Lp.css';
export default function LastPart() {
    var obj_l = [
      {
        h3_: "Top Earning",
        h2_: "$12,875",
        h6_: "Compare to $21,490 last year ",
      },
      {
        h3_: "Sales",
        h2_: "$43,123",
        h6_: "Compare to $21,490 last year ",
      },
    ];
  return (
    <div className="LP">
      <div className="LeftLp">
        <h1 id="LPH"> Design faster</h1>
        <div id="char_"></div>
        <div className="earning_total">
          {
            obj_l.map((e,i)=>{
                var {h3_,h2_,h6_}=e;
                return <div className='top_' key={i}>
                    <h3 id='h3'>{h3_} </h3>
                    <h5> {h2_} </h5>
                    <h6> {h6_} </h6>
                </div>
            })
          }
        </div>
        <div className="last_earning_total"></div>
      </div>
      <div className="RightLp"></div>
    </div>
  );
}
